// React
import React from "react";

// Third part
import { Table, Button, Divider } from "antd";

const { Column } = Table;

const Tables = ({
  data,
  colOne,
  colTwo,
  colThird,
  colFourth,
  colFive,
  addItem
}) => {
  return (
    <Table bordered dataSource={data} rowKey={data => data.id}>
      <Column title={colOne} dataIndex="name" />
      <Column title={colTwo} dataIndex="price" />
      <Column title={colThird} dataIndex="type" />
      <Column title={colFourth} dataIndex="date" />
      <Column
        title={colFive}
        render={(text, record) => (
          <span>
            <Button size="small" onClick={() => addItem(record)}>
              Delete
            </Button>
            <Divider type="vertical" />
            <Button size="small">Invite {}</Button>
          </span>
        )}
      />
    </Table>
  );
};

export default Tables;

